measurements.description:
One flat flower on one 20-cm inflorescence;
	dorsal sepal broad, white, overlaid green basally, heavy burgundy spots coalescing at midline, white margin;
	synsepal white, light green centrally, spotted burgundy, more heavily centrally;
	petals deep burgundy, yellow picotee;
	pouch deep burgundy, yellow top edge;
	staminode pale yellow, flushed burgundy, deep yellow centrally;
	substance firm; texture glossy.
